[note]Complete Website Design, Custom Web Development, Infrastructure Management.[/note]

PostNet found us when they had a growing need to redevelop their corporate website as well as give their franchise owners more control of their own websites. A heavy emphasis was placed on the individual store locations’ sites. PostNet listened to its customers who wanted an easy way to find the nearest location, so by using a combination of Google API, AJAX and HTML5 geolocation, we were able to provide a great responsive website experience and simultaneously provide users unrestricted functionality, regardless of device.

